import React, {useEffect, useState} from 'react';
import axios from "axios";

const Cast = ({id}) => {

    let url = `https://api.jikan.moe/v3/anime/${id}/characters_staff`;

    const [cast, setCast] = useState([]);


    useEffect(()=>{
        (async function()
        {
            try
            {
                const res = await axios.get(url);
                setCast(res.data.characters);
                console.log(res.data.characters);
            }
            catch(err)
            {
                console.log(err);
            }
        })();
    }, [url]);

    return (
        <div className='cast'>
            {cast.map((character, i)=>
            <div key={i}>
                
                {character.voice_actors.map((actor, i)=>actor.language.includes("Japanese") ? <div key={i}>{character.name}: {actor.name}</div> : (null))}
            </div>)}
            
        </div>
    )
}

export default Cast;
